// components/MyLayout.js

import Link from 'next/link';

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const withLayout = Page => {
  return () => (
    <div style={layoutStyle}>
      <Link href='/' />
      <Page />
    </div>
  );
};

export default withLayout;
